import React from "react";

import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import NavDropdown from "react-bootstrap/NavDropdown";

import { Link } from "react-router-dom";

export default function Navigationbar() {
  const showIncome = () => {
    const url = "http://localhost:8000/operations/income";

    fetch(url)
      .then((response) => {
        response.json();
      })
      .then((data) => console.log(data));
  };
  const showExpenses = () => {
    const url = "http://localhost:8000/operations/expenses";

    fetch(url)
      .then((response) => {
        response.json();
      })
      .then((data) => console.log(data));
  };

  return (
    <Navbar bg="dark" variant="dark" expand="lg">
      <Navbar.Brand>Personal Budget</Navbar.Brand>

      <Navbar.Toggle aria-controls="basic-navbar-nav" />

      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <Link to="/home">Home</Link>

          <Link to="/income">Income</Link>

          <Link to="/expenses">Expenses</Link>

          <Link to="/categories">Categories</Link>
        </Nav>
        <Nav className="ml-auto">
          <NavDropdown title="User" alignRight>
            <NavDropdown.Item>My profile</NavDropdown.Item>

            <NavDropdown.Divider />

            <NavDropdown.Item>Close session</NavDropdown.Item>
          </NavDropdown>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}
